import {Table, Modal} from "../component/Component";
import { useState } from "react";

function Siswa() {
  const [modal, setModal] = useState(false);
  const funcModal = () => {
    setModal(!modal);
  };
  const [data, setData] = useState();
  return (
    <div className="w-full h-screen flex">
        <Table setM={funcModal} setData={setData}/>
        <Modal setM={funcModal} name={`edit`} data={data} title={`Edit data siswa`} statE={modal}/>
        <Modal setM={funcModal} name={`hapus`} title={`Hapus`} statE={modal}/>
    </div>
  );
}
export default Siswa;
